DROP TABLE IF EXISTS "Lancamento";
CREATE TABLE "Lancamento" ("id" INTEGER PRIMARY KEY,"idCliente" INTEGER NOT NULL ,"dtLancamento" DATETIME NOT NULL ,"dtReferencia" DATETIME NOT NULL ,"dtLiquidacao" DATETIME NOT NULL ,"dtVencimento" DATETIME NOT NULL ,"dtOrigem" DATETIME NOT NULL ,"tipo" INTEGER NOT NULL ,"situacao" CHAR NOT NULL ,"historicoId" INTEGER NOT NULL  DEFAULT (null) ,"descricao" VARCHAR NOT NULL ,"valor" NUMERIC NOT NULL ,"diasProjetados" INTEGER,"idLancamentoExterno" INTEGER,"estorno" BOOL,"aguardandoRetornoSinacor" integer,"idLancamentoSinacor" int,"idLancamentoInterno" varchar(100), Status integer, CalculaSaldo BOOL);
